  font-size: 40px;
  color: #6A7C92; }

/*===== All Button Style =====*/
.theme-btn {
  display: inline-block;
  font-weight: 400;
  text-align: center;
  white-space: nowrap;
  vertical-align: middle;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  padding: 16px 48px;
  font-size: 18px;
  border-radius: 50px;
  color: #fff;
  cursor: pointer;
  z-index: 5;
  transition: all .4s ease-in-out;
  border: none;
  background: linear-gradient(to left, #FD580F 0%, #fda40f 50.39%, #FD580F 100%);
  background-size: 200% auto;
  overflow: hidden; }
  .theme-btn:hover, .theme-btn:focus {
    background-position: right center;
    color: #fff;
    -webkit-box-shadow: 0px 0px 30px rgba(253 88 15, 0.45);
    -moz-box-shadow: 0px 0px 30px rgba(253 88 15, 0.45);
    box-shadow: 0px 0px 30px rgba(253 88 15, 0.45); }
  .theme-btn.border-btn {
    padding: 14px 40px;
    background: transparent;
    border: 1.5px solid #FD580F;
    color: #6A7C92;
    font-size: 18px;
    -webkit-box-shadow: none;
    -moz-box-shadow: none;
    box-shadow: none; }

.scroll-top {
  width: 45px;
  height: 45px;
